- el carro de comida (ya lo construí yo mismo) (4 meses construyendo y 1,5mm$);
- el vehículo que tirará el carro de comida (ya lo compré) pero falta conectar carro y camioneta (camioneta costó 1,3mm$;
- hornos: la idea es mas complicada que un simple horno;
- electricidad: paneles solares fotovoltaicos;
- página web;
- persona que colabore en la producción, venta y entrega productos;

1.- personal:
- de alta capacidad e idoneidad en oficios y profesiones en el desempeño de sus tareas;
- su experiencia y disponibilidad para las funciones de su responsabilidad personal;
- conocimiento de la historia regional y local;
- dominio del idioma inglés.
2.- infraestructura (terreno, edificaciones y equipamiento de alta calidad).
3.- disponibilidad permanente y sin interrupciones de los servicios de electricidad, gas y agua.
4.- libros e impresos. mantener mapas y biblioteca actualizada (respecto de materias regionales).

se debe gestionar principalmente en 2 ejes ;
1-	la producción;
en primer lugar  de la materia prima orgánica, que es el sello e identidad principal del producto, que son las hierbas medicinales endémicas, esto implica disponer de un huerto y los implementos para mantenerlo  ,otro factor importante es poder disponer  de los instrumentos necesarios para aumentar la producción del producto y un espacio debidamente equipado para su elaboración que cuente con un lavamanos, mesones de acero inoxidable, fermentadores y los implementos necesarios para embazar óptimamente , imprescindible un alambique con mayor capacidad de producción .

2-	capacitación en marketing y venta , necesarias para el perfeccionamiento del producto y la eficiencia y economía en su elaboración.m
